import React from 'react';
import HeaderMain from './../../component/HeaderMain/HeaderMain';
import Footer from './../../component/Footer/Footer';

function UserLayout() {
  return (
    <div>
      <HeaderMain />
      <Route path="/home" exact>
        <Home />
      </Route>
      <Footer />
    </div>
  );
}

export default UserLayout;
